function Cell ({ 
    mine,
    dispatch,
    setCells,
    handleClickCell,
    index,
    settings
}) {

    return (
        <div 
            className="game-broad-cell"
            onClick={() => {
                dispatch(setCells())
            }}
        >
            {mine}
        </div>
    );
}

export default Cell;
